// Juggling Clubs Background Animation
// Adapted from juggling-clubs.html

(function() {
    "use strict";

    const GLB_BASE64 = "";
    
            let scene, camera, renderer;
            let world; // Cannon.js physics world for collisions only
            let jugglingClubs = [];
            let clubModel = null;
            let isModelLoaded = false;
    
            function init() {
                // Create scene
                scene = new THREE.Scene();
                scene.background = new THREE.Color(0x2a2a2a); // Dark gray background
    
                // Create physics world for collisions
                world = new CANNON.World();
                world.gravity.set(0, -1.5, 0); // Slower gravity
                world.broadphase = new CANNON.NaiveBroadphase();
                world.solver.iterations = 10;
    
                // Create camera
                camera = new THREE.PerspectiveCamera(
                    50,  // Reduced FOV to minimize edge distortion
                    window.innerWidth / window.innerHeight,
                    0.1,
                    1000
                );
                camera.position.z = 10;
    
                // Create renderer
                renderer = new THREE.WebGLRenderer({ antialias: true });
                renderer.setSize(window.innerWidth, window.innerHeight);
                document.getElementById('juggling-canvas').appendChild(renderer.domElement);
    
                // Add lights
                const ambientLight = new THREE.AmbientLight(0xffffff, 0.5);
                scene.add(ambientLight);
    
                const directionalLight = new THREE.DirectionalLight(0xffffff, 0.8);
                directionalLight.position.set(5, 10, 5);
                scene.add(directionalLight);
    
                // Handle window resize
                window.addEventListener('resize', onWindowResize, false);
    
                // Load the GLB model
                loadGLBModel();
            }
    
            function loadGLBModel() {
                const loader = new THREE.GLTFLoader();
                
                try {
                    // Decode base64 to binary
                    const binaryString = atob(GLB_BASE64);
                    const bytes = new Uint8Array(binaryString.length);
                    for (let i = 0; i < binaryString.length; i++) {
                        bytes[i] = binaryString.charCodeAt(i);
                    }
                    
                    // Parse the GLB from ArrayBuffer
                    loader.parse(
                        bytes.buffer,
                        '',
                        function(gltf) {
                            clubModel = gltf.scene;
                            console.log('✅ GLB model loaded successfully from base64!');
                            console.log('Model:', clubModel);
                            
                            // Debug: Log model structure
                            clubModel.traverse((child) => {
                                if (child.isMesh) {
                                    console.log('Found mesh:', child.name, 'vertices:', child.geometry.attributes.position.count);
                                }
                            });
                            
                            isModelLoaded = true;
                            
                            // Update info
                            // Info div removed for background version
                            
                            // Create the juggling clubs
                            createJugglingClubs();
                        },
                        function(error) {
                            console.error('❌ Error loading GLB:', error);
                            console.error('Error loading model:', error.message);
                        }
                    );
                } catch (error) {
                    console.error('❌ Error decoding base64:', error);
                    document.getElementById('info').textContent = 
                        'Error decoding base64: ' + error.message;
                }
            }
    
            function createJugglingClub() {
                if (!clubModel) return null;
                
                const club = clubModel.clone();
                club.scale.set(0.5, 0.5, 0.5);  // Smaller clubs
                
                // Randomize bulb color for each club
                const randomColor = Math.random() * 0xffffff;
                club.traverse((child) => {
                    if (child.isMesh && child.material) {
                        // Clone material so each club has its own
                        child.material = child.material.clone();
                        
                        // Change emissive color if it exists (this is the bulb)
                        if (child.material.emissive) {
                            child.material.emissive.setHex(randomColor);
                        }
                    }
                });
                
                // Random starting position - spread across entire visible height
                club.position.x = (Math.random() - 0.5) * 25;
                club.position.y = Math.random() * 30 - 10;  // Spread from -10 to +20 so clubs are already on screen
                club.position.z = (Math.random() - 0.5) * 10;
                
                // Random starting rotation
                club.rotation.x = Math.random() * Math.PI * 2;
                club.rotation.y = 0;
                club.rotation.z = 0;
                
                // Create physics body for collision detection
                const shape = new CANNON.Cylinder(0.3, 0.3, 2, 8);
                const body = new CANNON.Body({
                    mass: 1,
                    shape: shape,
                    position: new CANNON.Vec3(club.position.x, club.position.y, club.position.z),
                    linearDamping: 0.3,
                    angularDamping: 0.9  // High damping so physics doesn't affect rotation much
                });
                
                // Disable physics rotation by locking angular velocity
                body.angularVelocity.set(0, 0, 0);
                body.angularFactor = new CANNON.Vec3(0, 0, 0); // Prevent physics from rotating the body
                
                world.add(body);
                
                // Store physics body and rotation properties separately
                club.userData.physicsBody = body;
                club.userData.rotationX = 0.02;  // Consistent rotation speed
                
                return club;
            }
    
            function createJugglingClubs() {
                if (!isModelLoaded) {
                    console.log('⏳ Waiting for model to load...');
                    return;
                }
                
                // Create contact material for club-to-club collisions
                const clubMaterial = new CANNON.Material('club');
                const clubContactMaterial = new CANNON.ContactMaterial(clubMaterial, clubMaterial, {
                    friction: 0.3,
                    restitution: 0.4 // Moderate bounciness
                });
                world.addContactMaterial(clubContactMaterial);
                
                console.log('Creating 150 juggling clubs...');
                
                for (let i = 0; i < 150; i++) {
                    const club = createJugglingClub();
                    if (club) {
                        scene.add(club);
                        jugglingClubs.push(club);
                        
                    }
                }
                
                console.log(`✅ Created ${jugglingClubs.length} clubs`);
                console.log('Camera position:', camera.position);
                console.log('Scene children:', scene.children.length);
            }
    
            function updateClubs() {
                jugglingClubs.forEach(club => {
                    const body = club.userData.physicsBody;
                    
                    // Sync position from physics (for collisions)
                    club.position.copy(body.position);
                    
                    // Independent rotation (not affected by physics)
                    club.rotation.x += club.userData.rotationX;
                    
                    // Reset position when club falls below screen
                    if (club.position.y < -10) {
                        body.position.set(
                            (Math.random() - 0.5) * 25,
                            Math.random() * 20 + 10,
                            (Math.random() - 0.5) * 10
                        );
                        body.velocity.set(0, -2, 0);
                    }
                });
            }
    
            function animate() {
                requestAnimationFrame(animate);
                
                // Step physics simulation for collisions
                world.step(1 / 60);
                
                updateClubs();
                
                renderer.render(scene, camera);
            }
    
            function onWindowResize() {
                camera.aspect = window.innerWidth / window.innerHeight;
                camera.updateProjectionMatrix();
                renderer.setSize(window.innerWidth, window.innerHeight);
            }
    
            // Start the application
            init();
            animate();
})();
